import React from 'react';
import '../styles/LabStyle/LabWork3.css';
const LabWork3 = () => {
  const videos = [
    { id: '7nm0b', title: 'Название видео 1' },
    { id: '6m0me', title: 'Название видео 2' },
    { id: '4i4e0', title: 'Название видео 3' },
    { id: 'k76t1', title: 'Название видео 4' }
  ];

  return (
    <div className="lab3-container">
      {/* Левая боковая панель */}
      <div className="sidebar">
        <div className="user-section">
          <h4>Вы</h4>
          <ul>
            <li>Ваш канал</li>
            <li>История</li>
            <li>Ваши видео</li>
            <li>Просмотрено позже</li>
            <li>Загрузки</li>
            <li>Показать больше</li>
          </ul>
        </div>
        <hr />
        <div className="subscriptions">
          <h4>Подписки</h4>
          <ul>
            <li>WAS</li>
            <li>TheDRZJ</li>
            <li>ROZETKA</li>
            <li>Алексей Макаренко</li>
            <li>ROZETKA GAME</li>
            <li>Хащі</li>
            <li>Показать еще 24</li>
          </ul>
        </div>
      </div>
      
      {/* Основной контент */}
      <div className="main-content">
        <div className="video-grid">
          {videos.map((video, index) => (
            <div key={index} className="video-card">
              <div className="video-id">{`Відео ${video.id}`}</div>
              <div className="video-title">{video.title}</div> {/* Название видео под блоком */}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default LabWork3;
